import React from 'react';

const Disperse = () => {
  return (
    <div style={{ width: "100%", height: "100vh", backgroundColor: 'whitesmoke', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <div style={{ maxWidth: "10vw", backgroundColor: "white", textAlign: "center" }}>
        <h5>Addresses with Amounts</h5>
        <textarea cols={5} style={{ width: '100%' }}></textarea>
      </div>
    </div>
  )
}

export default Disperse;
